import React from "react";

// image
import appImge from "../assets/images/app.png";

function Contact() {
  return (
    <div className="relative  text-center py-0 px-[40px] mb-[80px]">
      <div className="text-left text-base ">
        <div className="text-lg font-bold my-4 md:text-base">
          Carry sweetness with you — nunu App is live
        </div>
        <span className="text-base">
          Wanna be the first to discover new cuties and flavors? Wanna take all
          your dessert friends home? Download the app — nunu will sweet-talk you
          every day!
        </span>
      </div>
      <img className="w-auto" src={appImge} alt="nunu Wheel cake" />
    </div>
  );
}

export default Contact;
